import React from 'react';
import {
    Route,
    Link,
    Switch
} from 'react-router-dom';

const Account = () => {
    return (
        <div className="account">
            <h3>Log in</h3>
            <h3>Don't have an account? <Link to='/account/register'>Register</Link></h3>
        </div>
    )
}

export default Account;
